// src/pages/delivery/DeliveryDashboard.jsx
import React, { useState, useEffect } from 'react';
import { Link } from 'react-router-dom';
import axios from 'axios';
import { useAuth } from '../../context/AuthContext';
import '../../styles/delivery/DeliveryDashboard.css';
const DeliveryDashboard = () => {
  const { user } = useAuth();
  const [dashboardData, setDashboardData] = useState({
    totalDeliveries: 0,
    completedToday: 0,
    totalEarnings: 0,
    rating: 0,
    recentDeliveries: []
  });
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);

  useEffect(() => {
    const fetchDashboardData = async () => {
      try {
        const token = localStorage.getItem('token');

        const response = await axios.get('http://localhost:8080/api/delivery/dashboard', {
          headers: {
            'Authorization': `Bearer ${token}`
          }
        });

        if (response.data) {
          setDashboardData({
            totalDeliveries: response.data.totalDeliveries || 0,
            completedToday: response.data.deliveredToday || 0,
            totalEarnings: response.data.totalEarningsToday || 0,
            rating: response.data.rating || 4.8, // Default rating if not provided
            recentDeliveries: response.data.recentDeliveries || []
          });
        }

        setLoading(false);
      } catch (err) {
        console.error('Dashboard fetch error:', err);
        setError('Failed to load dashboard data');
        setLoading(false);
      }
    };

    fetchDashboardData();
  }, []);

  if (loading) {
    return <div className="loading-container">Loading...</div>;
  }

  if (error) {
    return <div className="error-container">{error}</div>;
  }

  return (
    <div className="delivery-dashboard">




      <div className="dashboard-content">
        <h1>Delivery Dashboard</h1>
        <p>Welcome back, {user.name}</p>

        <div className="stats-grid">
          <div className="stat-card">
            <h3>Total Deliveries</h3>
            <p className="stat-value">{dashboardData.totalDeliveries}</p>
          </div>
          <div className="stat-card">
            <h3>Completed Today</h3>
            <p className="stat-value">{dashboardData.completedToday}</p>
          </div>
          <div className="stat-card">
            <h3>Total Earnings</h3>
            <p className="stat-value">${dashboardData.totalEarnings.toFixed(2)}</p>
          </div>
          <div className="stat-card">
            <h3>Your Rating</h3>
            <p className="stat-value">★ {dashboardData.rating.toFixed(1)}</p>
          </div>
        </div>

        <div className="action-buttons">
          <Link to="/delivery/available-orders" className="btn primary">
            View Available Orders
          </Link>
          <Link to="/delivery/order-history" className="btn secondary">
            Delivery History
          </Link>
        </div>

        <div className="recent-deliveries">
          <h2>Recent Deliveries</h2>
          {dashboardData.recentDeliveries.length > 0 ? (
            dashboardData.recentDeliveries.map((delivery) => (
              <div key={delivery.orderId} className="delivery-item">
                <div className="delivery-header">
                  <h3>{delivery.restaurantName}</h3>
                  <span className="status-badge">Completed</span>
                </div>
                <div className="delivery-details">
                  <div>
                    <strong>Order ID:</strong> {delivery.orderId}
                    <br />
                    <strong>Customer:</strong> {delivery.restaurantName}
                    <br />
                    <strong>Amount:</strong> ${delivery.earnings.toFixed(2)}
                  </div>
                  <div className="text-right">
                    <strong>Date:</strong> {new Date(delivery.completedAt).toLocaleDateString()}
                    <br />
                    <strong>Address:</strong> {/* Add address if available */}
                  </div>
                </div>
              </div>
            ))
          ) : (
            <p>No recent deliveries</p>
          )}
        </div>
      </div>
    </div>
  );
};

export default DeliveryDashboard;
